import React, { useEffect, useState } from 'react';
import {Line} from 'react-chartjs-2'
import GetData from './GetData';




const CovidChart = () => {
    var apiData = GetData();
    var nswCases, vicCases, label;
    const[covidData, setData] = useState(apiData);
    useEffect( () => {
      nswCases = covidData.nswCases;
      vicCases = covidData.vicCases
      labels = covidData.labels;
    }, [])
    return ( 
       <div>
           <button>1W</button>
           <button>1M</button>
           <button>3M</button>
        <Line
          data={{
            labels: labels,
            datasets: [
              {
                label: "NSW",
                data: nswCases,
                fill: false,
                borderColor: "#36a2eb",
                tension: 0.1,
              },
              {
                label: "Vic",
                data: vicCases,
                fill: false,
                borderColor: "#ff6384",
                tension: 0.1,
              }
            ],
          }}
        />
      </div>
    );
}

export default CovidChart;
